export default function Home() {
  return (
    <div className='content'>
      <h1>Home Page</h1>
      <p>
        Welcome to my profolio! My name is Alex Hickey and I am trying to become a software engineer!</p>

        <p>See the pages above to find out more about me!
      </p>
    </div>
  );
}
